        // GET: /<controller>/
        public async Task<IActionResult> Index()
        {

            //var similar = _blogPostService.GetSimilarPosts(new Guid("65852E3E-5FF2-E811-A69B-DBDFE24ACCF0"), 3);

            var defautStatus = (int)StatusEnum.visible;
            var dateVisibility = BlogPostDateVisibilityEnum.visibleToToday;
            int take = 3;


           var posts = await _blogPostService.AllAsync(0, take, dateVisibility, defautStatus);

            var blogTags = await _blogTagService.AllAsync(0, int.MaxValue);

            var resultTags = blogTags.Result;

            var model = new BlogViewModel
            {
                Posts = posts.Result,
                DomainUrl = GetDomainUrl(),
                BlogPostTags = resultTags,
                Take = take,  
                DateVisibility = dateVisibility,
                Status = defautStatus
            };
            return View("Index", model);
        }



    private string GetDomainUrl()
    {
        var scheme = HttpContext.Request.Scheme;
        var domainName = _configuration["DomainName"];

        var domainUrl = scheme + "://" + domainName;
        return domainUrl;
    }


    public string ImageToBase64(IFormFile file)
    {
        using (var ms = new MemoryStream())
        {
            file.CopyTo(ms);
            var fileBytes = ms.ToArray();
            return Convert.ToBase64String(fileBytes);

        }
    }

        [HttpPost]
        public async Task<IActionResult> BlogPostAddEdit(AddEditBlogPostViewModel model)
        {
            if (model.IsCoverImageChoised && model.CoverImage == null)
            {
                if (string.IsNullOrEmpty(model.ImageStr))
                {
                    ModelState.AddModelError("CoverImage", BlogResource.CovPicReq);
                }


            }

            if (model.IsVideoUrlChoised && model.VideoUrl == "")
            {
                ModelState.AddModelError("VideoUrl", BlogResource.CovVidReq);
            }


            if (!ModelState.IsValid)
            {
                var tagsResponce = await _blogTagService.AllAsync(0, int.MaxValue);
                model.Tags = tagsResponce.Result;
                model.Products = GetAllProducts();
                model.Statuses = GetAllStatuses();

                return View("AddEdit", model);
            }
            string image = "";

            if (model.IsCoverImageChoised)
            {
                if (model.CoverImage != null)
                {
                    image = ImageToBase64(model.CoverImage);
                } else if (!string.IsNullOrEmpty(model.ImageStr))
                {
                    image = model.ImageStr;
                }
            }

            var post = new BlogPostDto
            {
                Id = model.Id,
                Title = model.Title,
                CoverImage = image,
                VideoUrl = model.VideoUrl ?? "",
                ShortText = model.ShortText,
                FullText = model.FullText,
                Date = model.Date.Value,
                Product = int.Parse(model.Product),
                Status = int.Parse(model.Status),
                BlogTags = new List<BlogTagDto>()
            };
                        

            List<string> tagsIds = model.TagsIds.Split(", ").ToList();

            foreach (var tagid in tagsIds)
            {
                post.BlogTags.Add(new BlogTagDto
                {
                    Id = new Guid(tagid)
                });
            }

            if (post.Id == Guid.Empty )          
            {
               var result = await _blogPostService.AddAsync(post);              
               
            }
            else
            {               
               var result = await _blogPostService.EditAsync(post, post.Id);                          
               
            }

            return RedirectToAction("Index");
        }


        [HttpGet]
        public async Task<IActionResult> BlogPostEdit(Guid postId)
        {
            var responce = await _blogPostService.GetAsync(postId);

            var post = responce.Result;


            var tagsIds = String.Join(", ", post.BlogTags.Select(t => t.Id).ToArray());

            var tagsResponce = await _blogTagService.AllAsync(0, int.MaxValue);

            var model = new AddEditBlogPostViewModel
            {
                Id = post.Id,
                Title = post.Title,
                VideoUrl = post.VideoUrl ?? "",
                ShortText = post.ShortText,
                FullText = post.FullText,
                TagsIds = tagsIds,
                Date = post.Date,
                Product = post.Product.ToString(),
                Status = post.Status.ToString(),
                Products = GetAllProducts(),
                Statuses = GetAllStatuses(),
                Tags = tagsResponce.Result,
                ImageStr = post.CoverImage
            };


            if (post.CoverImage != "")
            {
                model.IsCoverImageChoised = true;
            } else if (post.VideoUrl != "")
            {
                model.IsVideoUrlChoised = true;
            }

            return View("AddEdit", model);
        }

