        [HttpPost]
        public async Task <IActionResult> PostDesactiveConfirm (BlogPostDto model)
        {
            var responce = await _blogPostService.GetAsync(model.Id);

            var post = responce.Result;
               
            post.Status = 2;

            var result = await _blogPostService.EditAsync(post, post.Id);
            var postStatus = (StatusEnum)post.Status;

            var type = postStatus.GetType();
            var member = type.GetMember(postStatus.ToString());
            DisplayAttribute displayName = (DisplayAttribute)member[0].GetCustomAttributes(typeof(DisplayAttribute), false).FirstOrDefault();

            //var seasonDisplayName = displayName.GetDisplayName();

            return Json(new { isFailed = result.IsFailed, status = displayName.Name, postId = post.Id, massage = result.Massage});
        }
          
        
