        [HttpPost]
        public async Task<IActionResult> Tags(int skip, int take, string searchString = null)
        {
            if (take == 0)
            {
                take = int.MaxValue;
            }

            var tagsResponce = await _blogTagService.AllAsync(skip, take, searchString);

            var tags = tagsResponce.Result;

            return PartialView("_Tags", tags);

        }

        [HttpGet]
        public async Task<IActionResult> Posts(int skip, int take, BlogPostDateVisibilityEnum dateVisibility, int status = -1, string tagsIdsStr = null, string searchString = null)
        {           
            if (take == 0)
            {
                take = int.MaxValue;
                               
            }

            List<Guid> tagsIds = null;

            if (tagsIdsStr != null)
            {
                tagsIds = JsonConvert.DeserializeObject<List<Guid>>(tagsIdsStr);
            }


            var postsResponce = await _blogPostService.AllAsync(skip, take, dateVisibility, status, tagsIds, searchString);

            var posts = postsResponce.Result;

            
            var vewModel = new PlogPostsViewModel
            {
                Posts = posts,
                DomainUrl = GetDomainUrl()
            };

            return PartialView("_Posts", vewModel);

        }

               

        private List<SelectListItem> GetAllProducts()
