                new SelectListItem { Value = "0", Text = BlogResource.Bilder },
                new SelectListItem { Value = "1", Text = BlogResource.SMSM },
                new SelectListItem { Value = "2", Text = BlogResource.Automation },
                new SelectListItem { Value = "3", Text = BlogResource.NoProduct },
                new SelectListItem { Value = "4", Text = BlogResource.MailM }
            };
            return products;
        }

        private List<SelectListItem> GetAllStatuses()
        {
            var statuses = new List<SelectListItem>
            {
                new SelectListItem { Value = "0", Text = BlogResource.Visible },
                new SelectListItem { Value = "1", Text = BlogResource.Draft },
                new SelectListItem { Value = "2", Text = BlogResource.Inactive },
            };

            return statuses;
        }


