        [HttpGet]
        public async Task<IActionResult> DuplicatePost(Guid postId)
        {
            var responce = await _blogPostService.GetAsync(postId);

            var post = responce.Result;

            post.Id = Guid.Empty;

            post.Title = post.Title + " Copy";

            var responceDuplicatePost = await _blogPostService.AddAsync(post);


            var newPost = responceDuplicatePost.Result;


            return RedirectToAction("ShowFullBlogPost", new { postId = newPost.Id });
        }


        [HttpGet]
        public async Task<IActionResult> ShowFullBlogPost(Guid postId)
        {
            var responce = await _blogPostService.GetAsync(postId);

            var post = responce.Result;

            //List<BlogPostDto> similarPosts = SimilarPostsFake(postId);

            var responceSimilarPosts = await _blogPostService.GetSimilarPosts(postId, 3);


            var rightSidePosts = new List<BlogPostDto>();

            var similarPosts = responceSimilarPosts.Result;

            var rightSidePostsTitle = string.Empty;

            var visiblePostsToToday = BlogPostDateVisibilityEnum.visibleToToday;

            if (similarPosts.Count == 0)
            {
                rightSidePostsTitle = BlogResource.OtherPosts;
                var responceRightSidePosts = await _blogPostService.AllAsync(0, 4, visiblePostsToToday);
                rightSidePosts = responceRightSidePosts.Result.Where(p => p.Id != postId).Take(3).ToList();
            }
            else
            {
                rightSidePostsTitle = BlogResource.SimilarPosts;
                rightSidePosts = similarPosts;
            }
          
            var viewModel = new BlogPostViewModel
            {
                Post = post,
                DomainUrl = GetDomainUrl(),
                RightSidePosts = rightSidePosts,
                RightSidePostsTitle = rightSidePostsTitle
            };
            
            return View("ShowFullBlogPost", viewModel);
        } 
               
